Преференции работодателей

3-я группа инвалидности является рабочей. Тем не менее работодатель обязан создавать определенные условия обладателям этой категории.

Так, им запрещено предоставлять условия труда, худшие по сравнению с другими работниками.
Люди с инвалидностью имею право на более продолжительный:
оплачиваемый отпуск (не менее 30 суток);
неоплачиваемые дни отдыха (до 60 дней в год).

Работодатель обязан получить письменное согласие инвалида для привлечения его к работе:
сверх нормированного рабочего времени;
ночью;
в выходные и праздничные дни.

Большое политическое ток-шоу Украинский формат на NewsOne. Гости первого эфира третий президент Грузии Михаил Саакашвили и внефракционный народный депутат, лидер партии За життя. Также в гостях студии:
– Иван Крулько, народный депутат от фракции Батькищина;
– Андрей Лозовой, народный депутат от фракции Радикальная партия Олега Ляшко;
– Надежда Савченко, внефракционный народный депутат;
– Мустафа Найем, народный депутат от фракции Блок Петра Порошенко;
– Иван Винник, народный депутат от фракции Блок Петра Порошенко;
– Михаил Добкин, внефракционный народный депутат. 

