Евгений Мураев, глава политсовета партии ЗА ЖИТТЯ, в программе «Большой вечер» с Еленой Кирик на телеканале NewsOne, 15.11.17

Обсуждаемые темы:
– проект госбюджета-2018;
– земельная реформа в Украине;
– сотрудничество МВФ и Украины;
– конфликт между антикоррупционными органами;
– законопроект о реинтеграции Донбасса;
– Медведчук обратился к Путину по вопросу военнопленных.

Политолог Андрей Мишин в своём интервью на UKRLIFE.TV в День философа рассказал о том, как могла бы выглядеть украинская философия внешней политики:

Украинским дипломатам основ философских нехватает. И Климкину, и даже такому великому дипломату, как наш Президент, который был руководителем МИДа. Была бы философия внешней политики Украины - мы бы гораздо удобнее чувствовали себя в мире, находясь под внешним управлением и даже осознали бы себя уютнее и конфуциански. Если взять такого [украинского] Конфуция, то, наверное, казак Мамай - это образец. Казак Мамай, который сидит и спокойно размышляет на перекрёстке всех дорог (ведь геополитически и географически мы страна-перекрёсток) как себя вести. Ведь на перекрёстках, как нам известно, собирается вся нечисть, с которой надо или бороться, или находить общий язык. Пока что, как мы видим, наша власть не продвинулась в этом мамаизме, - сказал политолог.

Касательно внутренней политики Украины Андрей Мишин отметил, что фактически в стране стал очевидным конфликт центра и региона:

Конфликт, который приходит - это для всех очевидно - центра и региона. Такие конфликты всегда с внешним участием [происходят]. Но тут прямые участники - центр и регион. Ничего нового Новинский не сказал. А косвенные участники - США, ЕС, и самый главный косвенный участник - Россия, - считает гость.

